import React from "react";
import './users.scss';

const users = () => {
  return (
    <div className="container-fluid mt-5">
      <div className="row text-center">
        <div className="frame">
          <div className="id">
            <p>12</p>
          </div>
          <div className="email">
            <p>aadityajp0419@gmail.com</p>
          </div>
          <div className="firstName">
            <p>Aaditya</p>
          </div>
          <div className="lastName">
            <p>Padte</p>
          </div>
          <div className="avater">
            <img src="" alt="logo" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default users;
